import { Gender } from 'src/Components/SelectGenderButton/SGInterface';
import characterDataList from 'src/Components/CharacterData/characterData';

export const SGList:Gender[] = characterDataList.flatMap(character => [
    { selectGender: character.select1, },
    { selectGender: character.select2, },
    { selectGender: character.select3, },
    { selectGender: character.select4, },
]);
